import React from 'react';
import {add, subs, multi, div} from './Calculator';


function Cal() {
    return(
        <>
            <ul>
                <li>Addition of two number is {add(10,20)}</li>
                <li>Substraction of two number is {subs(10,20)} </li>
                <li>Multiplication of two number is {multi(10,20)} </li>
                <li>Division of two numebr is {div(10,5)} </li>
            </ul>
        </>
    )
}

export default Cal;
